import getAuthor from "./authorHelper";
import "../models/detailItem";
class DetailHelpers {
    constructor() {}
    buildResponse =(dataMeli:any) => {
        var resp={
            author:getAuthor()
        }
        return dataMeli;

    }
    getItem=(dataMeli:any): detailItem =>{
        var resp : detailItem = {
            id:dataMeli.id,
            city:"algo",
            condition:"a"
        };
    
        
        return resp;
        }

    
}
export default DetailHelpers;
